import React, { Component, Fragment } from "react";
import "./App.css";
import { Header, Footer } from "./components/layouts";
import Body from "./components/content/Body";

class App extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <Fragment>
        <Header />

        <Body />

        <Footer />
      </Fragment>
    );
  }
}

export default App;
